class FacialHairItem {

    readonly id: FacialHairType;
    readonly category: FacialHairCategory;
    readonly svg: string;
    readonly name: string;

    constructor(id: FacialHairType, category: FacialHairCategory, name: string, svg: string) {
        this.id = id;
        this.category = category;
        this.name = name;
        this.svg = svg;
    }
}


class FacialHairCatalog {

    private static _instance: FacialHairCatalog;

    items = [
        new FacialHairItem(FacialHairType.None, FacialHairCategory.Shadow, "None", ""),
        new FacialHairItem(FacialHairType.None, FacialHairCategory.Moustache, "None", ""),
        new FacialHairItem(FacialHairType.None, FacialHairCategory.Beard, "None", ""),
        new FacialHairItem(FacialHairType.FiveOclockShadow, FacialHairCategory.Shadow, "Five o'clock Shadow", FiveOclockShadow.Head5),
        new FacialHairItem(FacialHairType.SoulPatch, FacialHairCategory.Beard, "Soul Patch", SoulPatch),
        new FacialHairItem(FacialHairType.BushyChinBeard1, FacialHairCategory.Beard, "Bushy Chin Beard 1", BushyChinBeard1),
        new FacialHairItem(FacialHairType.BushyGoatee, FacialHairCategory.Beard, "Bushy Goatee", BushyGoatee),
        new FacialHairItem(FacialHairType.BasicMoustache, FacialHairCategory.Moustache, "Basic Moustach", BasicMoustache),
        new FacialHairItem(FacialHairType.GeneralChangMoustache, FacialHairCategory.Moustache, "Corner of Mouth Moustach", GeneralChangMoustache),
        new FacialHairItem(FacialHairType.BushyMoustache1, FacialHairCategory.Moustache, "Bushy Moustach 1", BushyMoustache1),
        new FacialHairItem(FacialHairType.BushyMoustache2, FacialHairCategory.Moustache, "Bushy Moustach 2", BushyMoustache2),
        new FacialHairItem(FacialHairType.PencilMoustache, FacialHairCategory.Moustache, "Pencil Moustach", PencilMoustache),
        new FacialHairItem(FacialHairType.LargeBeard1, FacialHairCategory.MoustacheAndBeard, "Large Beard 1", LargeBeard1),
        new FacialHairItem(FacialHairType.LargeBeard2, FacialHairCategory.MoustacheAndBeard, "Large Beard 2", LargeBeard2),
    ]

    public static get instance() {
        if (FacialHairCatalog._instance == null) {
            FacialHairCatalog._instance = new FacialHairCatalog();
        }
        return FacialHairCatalog._instance;
    }

    static shift(svg: string) {
        if (svg?.length) {
            return `<g transform="translate(20,0)">` + svg + `</g>`;
        } else {
            return svg;
        }
    }

    getFacialHair(token: Token, category: FacialHairCategory) {
        let result = "";
        this.items.forEach(i => {
            if (token.facialHairType.indexOf(i.id) >= 0) {
                let svg = i.svg;

                if (i.id === FacialHairType.FiveOclockShadow) {
                    let key = 'Head' + (token.headType + 1);
                    let temp = FiveOclockShadow[key];
                    if (temp) {
                        svg = temp;
                    }
                    svg = FacialHairCatalog.shift(svg);
                }

                if (i.category === category) {
                    result += svg.replace(SpeciesRestrictions.DEFAULT_HAIR_COLOR_REGEX, token.hairColor);
                } else if (i.category === FacialHairCategory.MoustacheAndBeard && category === FacialHairCategory.Beard) {
                    result += svg.replace(SpeciesRestrictions.DEFAULT_HAIR_COLOR_REGEX, token.hairColor);
                }
            }
        });
        return result;
    }

    getSwatches(token: Token, category: FacialHairCategory) {
        return this.items
            .filter(i => i.category === category || (i.category === FacialHairCategory.MoustacheAndBeard && category === FacialHairCategory.Beard))
            .map(i => new Swatch(i.id, i.name, (token) => FacialHairCatalog.decorateSwatch(i, token)));
    }

    getCategoryForType(type: FacialHairType) {
        let types = this.items.filter(i => i.id === type);
        return types?.length ? types[0].category : FacialHairCategory.MoustacheAndBeard;
    }

    private static decorateSwatch(item: FacialHairItem, token: Token) {
        if (item.category === FacialHairCategory.Moustache) {
            let result = `<svg viewBox="0 0 100 100" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                    <g transform="translate(-255, -140)">`
                + DefaultLip.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, "#ffffff")
                + item.svg.replace(SpeciesRestrictions.DEFAULT_HAIR_COLOR_REGEX, token.hairColor)
                + `</g>
                </svg>`;
            return result;
        } else if (item.category === FacialHairCategory.Shadow) {
            let result = `<svg viewBox="0 0 100 100" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <g>
                    <g transform="translate(-255, -150)">`
                + FacialHairCatalog.shift(item.svg).replace(SpeciesRestrictions.DEFAULT_HAIR_COLOR_REGEX, token.hairColor)
                + DefaultLip.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, "#ffffff")
                + `</g>
                  </g>
                </svg>`;
            return result;
        } else {
            let result = `<svg viewBox="0 0 150 150" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <defs>
                    <clipPath id="facialHairClipPath` + item.id + `">
                        <circle cx="75" cy="75" r="75" fill="#ffffff" />
                    </clipPath>
                </defs>
                <g clip-path="url(#facialHairClipPath` + item.id + `">
                    <g transform="translate(-225, -150)">`
                + DefaultLip.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, "#ffffff")
                + item.svg.replace(SpeciesRestrictions.DEFAULT_HAIR_COLOR_REGEX, token.hairColor)
                + `</g>
                  </g>
                </svg>`;
            return result;
        }
    }
}

export default FacialHairCatalog;